The Margaret Brown Dutch Houses Photograph Collection spans the period from ca. 1920 to ca. 1936 and primarily contains photographs documenting houses built by Dutch immigrants during the eighteenth century in New Jersey and New York. The collection is divided into three series based on the books in which the images appeared: 
                Dutch Houses in the Hudson Valley Before 1776; 
                Pre-Revolutionary Dutch Houses and Families in Northern New Jersey and Southern New York; and Unidentified.
